/*Table structure for table `fly__wholesale_order_info` */

DROP TABLE IF EXISTS `fly__wholesale_order_info`;

CREATE TABLE `fly__wholesale_order_info` (
  `order_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `main_order_id` int(11) unsigned NOT NULL DEFAULT '0',
