/*Data for the table `fly_drp_config` */

insert  into `fly_drp_config`(`id`,`code`,`type`,`store_range`,`value`,`name`,`warning`,`sort_order`) values (1,'notice','textarea','','亲，您的佣金由三部分组成：\r\n1.本店所销售的商品，我所获得的佣金（即本店销售佣金）\r\n2.下级分店所销售的商品，我所获得的佣金（即一级分店佣金）\r\n3.下级分店发展的分店所销售的商品，我所获得的佣金（即二级分店佣金）','温馨提示','申请成为分销商时，提示用户需要注意的信息',0),(2,'novice','textarea','','1、开微店收入来源之一：您已成功注册微店，已经取得整个商城的商品销售权，只要有人在您的微店购物，即可获得“本店销售佣金”。\r\n2、开微店收入来源之二：邀请您的朋友注册微店，他就会成为你的分销商，他店内销售的商品，您即可获得“一级分店佣金”。\r\n3、开微店收入来源之三：您的分销商邀请他的朋友注册微店，他店内销售的商品，您即可获得“二级分店佣金”。','新手必读','分销商申请成功后，用户要注意的事项',0),(3,'withdraw','textarea','','可提现金额为交易成功后7天且为提现范围内的金额','提现提示','申请提现时，少于该值将无法提现',0),(4,'draw_money','text','','10','提现金额','申请提现时，少于该值将无法提现',0),(5,'issend','radio','0,1','1','消息推送','申请店铺成功时,推送消息到微信',0),(6,'isbuy','radio','0,1','0','购买成为分销商','是否开启购买成为分销商,默认申请成为分销商',0),(7,'buy_money','text','','100','购买金额','购买金额达到该数值,才能成为分销商',0),(8,'isdrp','radio','0,1','1','商品分销模式','是否开启分销模式,默认分销模式。控制商品详情页‘我要分销’按钮',0),(9,'ischeck','radio','0,1','0','分销商审核','成为分销商,是否需要审核',0),(10,'drp_affiliate','','','a:3:{s:6:\"config\";a:3:{s:3:\"day\";s:1:\"7\";s:6:\"expire\";s:1:\"7\";s:11:\"expire_unit\";s:3:\"day\";}s:4:\"item\";a:3:{i:0;a:3:{s:8:\"credit_t\";s:3:\"30%\";s:8:\"credit_y\";s:3:\"40%\";s:8:\"credit_j\";s:3:\"50%\";}i:1;a:3:{s:8:\"credit_t\";s:3:\"10%\";s:8:\"credit_y\";s:3:\"20%\";s:8:\"credit_j\";s:3:\"30%\";}i:2;a:3:{s:8:\"credit_t\";s:2:\"5%\";s:8:\"credit_y\";s:3:\"10%\";s:8:\"credit_j\";s:3:\"20%\";}}s:2:\"on\";s:1:\"1\";}','三级分销比例','',0),(11,'custom_distributor','text','','代言人','自定义“分销商”名称','替换设定的分销商名称',0),(12,'custom_distribution','text','','代言','自定义“分销”名称','替换设定的分销名称',0),(13,'commission','radio','0,1','1','是否显示佣金比例','控制店铺页面是否显示佣金比例',0),(14,'count_commission','radio','0,1,2','3','按时间统计分销商佣金排行','按时间统计分销商佣金进行分销商排行，可以按 周，月，年 排行',0),(15,'register','radio','0,1','0','开启分销商店铺自动注册','开启分销商店铺自动注册后，授权登录，关注商城会自动创建一个分销商店铺',0),(16,'qrcode','hidden','','a:5:{s:10:\"backbround\";s:75:\"http://localhost/dsc244/data/attached/qrcode/themes/drp_bg.png?v=1514591175\";s:11:\"qr_position\";a:2:{s:4:\"left\";s:3:\"172\";s:3:\"top\";s:3:\"308\";}s:6:\"avatar\";s:1:\"1\";s:11:\"av_position\";a:2:{s:4:\"left\";s:2:\"92\";s:3:\"top\";s:2:\"18\";}s:4:\"text\";a:2:{s:11:\"description\";s:0:\"\";s:5:\"color\";s:7:\"#000000\";}}','名片二维码配置','',0);

