insert  into `fly_merchants_steps_title`(`tid`,`fields_steps`,`fields_titles`,`steps_style`,`titles_annotation`,`fields_special`,`special_type`) values (1,1,'卖家入驻联系人信息',0,'用于入驻过程中接收商创反馈的入驻通知，请务必正确填写。','','0'),(2,2,'营业执照信息（副本)',0,'','以下所需要上传电子版资质仅支持JPG、GIF、PNG格式的图片，大小不超过1M，且必须加盖企业彩色公章。','1'),(3,2,'组织机构代码证',0,'','','1'),(12,8,'税务登记证',0,'以下所需要上传电子版资质仅支持JPG、GIF、PNG格式的图片，大小不超过1M，且必须加盖企业彩色公章。','','0'),(13,8,'开户银行许可证',0,'','','0'),(14,4,'经营信息',0,'','','0'),(15,4,'是否收到大商创其他商家邀请',0,'请录入推荐商家的商家ID，并上传用于证明店铺实力的电子版文件。 <a href=\'#\'>详情查看>></a>','','0'),(16,4,'是否收到以下大商创垂直站邀请',0,'如未收到邀请请勿填写。','','0'),(17,5,'选择店铺类型',1,'','','0'),(18,5,'选择可经营类目',2,'','','0'),(19,6,'新品牌信息',3,'最多可添加10条品牌信息，更多品牌可以在入驻成功后继续申请开通。','<div class=\"yel-tip\">\r\n<div class=\"content\">\r\n1. 信息提交前，请务必先了解\r\n<a class=\"link-blue\" target=\"_blank\" href=\"http://help.jd.com/Vender/viewQuestion-1004-2597.html\">大商创开放平台招商资质标准细则；</a>\r\n<br>\r\n2. 经营品牌类信息需填项较多，建议先查看\r\n<a class=\"link-blue\" target=\"_blank\" href=\"http://help.jd.com/Vender/viewQuestion-779-2555.html\">品牌添加注意事项</a>\r\n再进行填写；\r\n<br>\r\n3. 以下所需要上传电子版资质仅支持JPG、GIF、PNG格式的图片，大小不超过1M，且必须加盖企业彩色公章。\r\n</div>\r\n</div>','1'),(20,9,'店铺名称',4,'<font>仅作为参考，最终已审核通过的店铺名称为准。</font>','','0'),(26,10,'搜索网站品牌',3,'','<div class=\"yel-tip\">\r\n<div class=\"content\">\r\n                        <ul>\r\n                            <li>1、请准确录入《商标注册证》、《商标注册受理通知书》或《销售类授权书》中标识的品牌名称，如名称不一致，将无法通过审核；<br></li>\r\n                            <li>2、品牌中英文名称至少一项必填，录入规则查看<a target=\"_brank\" href=\"#\">《品牌名称录入规则》</a>；<br></li>\r\n                            <li>3、当品牌同时存在中英文名称时，请分别输入中英文名称；<br></li>\r\n                            <li>4、当品牌仅存在中文名称时，仅输入中文名称即可，英文名称留空；<br></li>\r\n                            <li>5、当品牌仅存在英文名称时，仅输入英文名称即可，中文名称留空。</li>\r\n                        </ul>\r\n                    </div>\r\n</div>','1');

