  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_order_sn` varchar(255) NOT NULL DEFAULT '' COMMENT '收款订单号',
  `pay_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '收款金额',
