  `type` varchar(60) NOT NULL DEFAULT '1' COMMENT '店铺或专题',
  `page_id` int(160) unsigned NOT NULL DEFAULT '0' COMMENT '店铺ID或专题ID',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
