insert  into `fly_zc_goods`(`id`,`pid`,`limit`,`backer_num`,`price`,`shipping_fee`,`content`,`img`,`return_time`,`backer_list`) values (1,4,3,1,'3000','0','一套设备','data/zc_product_images/1469556603531857837.jpg',30,'188'),(2,4,100,0,'7000','0','两套设备','data/zc_product_images/1469559521962750229.jpg',30,''),(3,5,-1,0,'1','0','每满150位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得记忆棉靠垫1个。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。','data/zc_product_images/1469561890900373306.jpg',30,''),(4,5,300,0,'259','0','感谢您的支持，将会获得记忆棉多功能腰背靠垫和配套的记忆棉美臀坐垫各1个。','data/zc_product_images/1469561945839544961.jpg',30,''),(5,6,-1,0,'1','0','恭喜您以渠道专享价获得：携茶道天作+携茶道玄鸟各20套+市场价58元的茶道礼包20份。享受分享的喜悦，感谢有你，生活更加多彩。','data/zc_product_images/1469562170500027679.jpg',30,''),(6,6,50,0,'998','0','恭喜您以众筹首发价获得：携茶道天作一套（茶盘为鸡翅木，含收藏证书），世界那么大，带着它去远方，尝一尝另一般生活的滋味。天作高山，大王荒之。彼作矣，文王康之。彼徂矣，岐有夷之行。子孙保之。名曰天作。','data/zc_product_images/1469562217924344186.jpg',30,''),(7,7,-1,0,'50','0','可获得陈富息古法手作的横山豆腐乳乾隆贡180g×2瓶； 乾隆贡分享装90g×1瓶','data/zc_product_images/1469562479289457048.jpg',10,''),(8,7,100,0,'100','0','可获得陈富息古法手作的横山豆腐乳乾隆贡180g×4瓶； 手剁辣椒酱分享装180g ×2瓶','data/zc_product_images/1469562499927290649.jpg',10,''),(9,8,-1,0,'1','0','每满99位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得凤冈锌硒茶1套（1罐红茶+1罐茗珠）。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。','data/zc_product_images/1469562874103382555.jpg',30,''),(10,8,2000,0,'99','0','凤冈锌硒茶1套（1罐红茶+1罐茗珠）','data/zc_product_images/1469562897477245574.jpg',30,''),(11,9,-1,0,'1','0','每满700位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得菲星智能后视镜记录仪P8一套。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。','data/zc_product_images/1469568038615880070.jpg',30,''),(12,9,500,0,'699','0','谢谢您的支持！您将以超值众筹的价格，获得菲星智能后视镜行车记录导航仪1套。（配后摄像头。请自行配TF卡，）','data/zc_product_images/1469568025120342666.jpg',30,''),(13,10,-1,0,'1','0','每满89位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得onread智能排插升级版（WIFI分控）1支。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。','data/zc_product_images/1469568253632088242.jpg',30,''),(14,10,2000,0,'39','0','支持39元限2000人 非常感谢您的支持！您可以用低于成本的价格获得onread排插标准版（2USB 4位插孔）1支 （注明：此款不支持WIFI控制） 限额2000人','data/zc_product_images/1469568280177629133.jpg',30,''),(15,11,-1,0,'1','0','每满128位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得马来西亚猫山王速冻肉200克一盒。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。','data/zc_product_images/1469568673476363449.jpg',30,''),(16,11,500,0,'198','0','感谢您的支持，在众筹结束后 您将获得预估市场价258元的马来西亚猫山王速冻肉400克一盒（顺丰空运，冷藏包装） 偏远地区港澳台勿拍（黑龙江、吉林、甘肃、内蒙古、宁夏、青海、辽宁、新疆、西藏地区）感谢您的支持。','data/zc_product_images/1469568703663762791.jpg',30,'');

